import * as React from "react";
import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import LoginAndRegister from "./components/loginandregister";
import HomePage from "./components/homepage";
import AllPosts from "./allposts";
import MyPostsPage from "./myposts";
import PostDetails from "./postdetails";

export default function App() {
  return(
    <BrowserRouter>
      <div style={{display: "flex"}}>
        <div>
          <NavLink to="/">Home</NavLink>
        </div>
        <div>
          <NavLink to="/myposts">My Posts</NavLink>
        </div>
      </div>
      <Routes>
        <Route exact path="/" element={<LoginAndRegister />} />
        <Route exact path="/home" element={<HomePage />} />
        <Route exact path="/home" element={<AllPosts />} />
        <Route exact path="/home/myposts" element={<MyPostsPage username={username} />} />
        <Route path="/post/:post_id" element={<PostDetails />} />
      </Routes>
    </BrowserRouter>
  )
}
